// importuj dropdown menu ze SP.vue
<template>
  <div class="box">
    <base-dropdown class="dd"
                    menu-classes="dropdown-black" 
                    title-classes="btn btn-secondary"> 
      <ul style="list-style-type: none;">
        <tr v-for="backtest in backtests">
          <td style="border-top: 0px; margin-top: 10px;">
            {{backtest}}
          </td>
        </tr>
      </ul>
    </base-dropdown>   
  </div>
</template>

<script>
  import {BaseDropdown} from "@/components";

  var backtests = ["b1", "b2"]

  export default {
    components: {
      BaseDropdown
    },
    data() {
      return{
        backtests: backtests
      }
    }
  };
  
</script>
<style>
.dd {
  float: middle;
  width: 10%
}
</style>
